cination sera.","Potential reduction in neutralization by some EUA monoclonal antibody treatments. Potential reduction in neutralization by post-vaccination sera.","Potential reduction in neutralization by some EUA monoclonal antibody treatments. Potential reduction in neutralization by post-vaccination sera.","Potential reduction in neutralization by some EUA monoclonal antibody treatments. Potential reduction in neutralization by post-vaccination sera.","Potential reduction in neutralization by some EUA monoclonal antibody treatments. Potential reduction in neutralization by post-vaccination sera.","Potential reduction in neutralization by some EUA monoclonal antibody treatments. Potential reduction in neutralization by post-vaccination sera.","Potential reduction in neutralization by some EUA monoclonal antibody treatments. Potential reduction in neutralization by post-vaccination sera.","Potential reduction in neutralization by some EUA monoclonal antibody treatments. Potential reduction in neutralization by post-vaccination sera.","NaN","NaN","NaN","NaN","NaN","NaN","NaN"],"type":["VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOC","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI","VOI"]},"selected":{"id":"5315"},"selection_policy":{"id":"5316"}},"id":"1002","type":"ColumnDataSource"},{"attributes":{},"id":"5710","type":"AllLabels"},{"attributes":{"end":-12084930.86104009,"start":-11487905.591091944},"id":"1018","type":"Range1d"},{"attributes":{"align":"center","style":{"margin-top":"1em","text-align":"center","width":"100%"},"text":"\n        &lt;div&gt;\n        B-10, Bioscience Div, Los Alamos National Laboratory \u00a92021\n        &lt;/div&gt;\n        ","width":1000},"id":"1014","type":"Div"},{"attributes":{"text":"\n        Multiple variants of SARS-CoV-2, the virus that causes COVID-19, have emerged or spread throughout different parts of the world, including the United States. Variant viruses may carry mutations that could be associated with differences in diagnostic test performance, changes in disease epidemiology, clinical outcomes, and effectiveness of certain therapeutics or vaccines. The genome information and metadata are downloaded from the Global Initiative on Sharing Avian Influenza Data (GISAID).\n        ","width":1000},"id":"1005","type":"Paragraph"},{"attributes":{},"id":"5711","type":"CategoricalTickFormatter"},{"attributes":{"text":"\n        Notable variants of SARS-CoV-2 and notable mutations found.\n        D614G: Logarithmic Prevalence of D614G in 2020 according to sequences in the GISAID database D614G is a missense mutation that affects the spike protein of SARS-CoV-2. The frequency of this mutation in the viral population has increased during the pandemic. G (glycine) has replaced D (aspartic acid) at position 614 in many countries, especially in Europe though more slowly in China and the rest of East Asia, supporting the hypothesis that G increases the transmission rate, which is consistent with higher viral titers and infectivity in vitro.\n        E484K: The name of the mutation, E484K, refers to an exchange whereby the glutamic acid (E) is replaced by lysine (K) at position 484. 484K has been reported to be an escape mutation (i.e., a mutation that improves a virus's ability to evade the host's immune system[138][139]) from at least one form of monoclonal antibody against SARS-CoV-2, indicating there may be a \"possible change in antigenicity\".\n        N501Y denotes a change from asparagine (N) to tyrosine (Y) in amino-acid position 501. Variants with N501Y include P.1 (Brazil/Japan), Variant of Concern 20DEC-01 (UK), 501.V2 (South Africa), and COH.20G/501Y (Columbus, Ohio). This last became the dominant form of the virus in Columbus in late December 2020 and January and appears to have evolved independently of other variants.\n        S477G/N: A highly flexible region in the receptor binding domain (RBD) of SARS-CoV-2, starting from residue 475 and continuing up to residue 485, was identified using bioinformatics and statistical methods in several studies.\n        P681H: Logarithmic Prevalence of P681H in 2020 according to sequences in the GISAID database In January 2021, scientists reported in a preprint that the mutation 'P681H', a characteristic feature of the significant novel SARS-CoV-2 variants detected in the U.K. (B.1.1.7) and Nigeria (B.1.1.207), is showing a significant exponential increase in worldwide frequency, similar to the now globally prevalent 'D614G'.\n        ","width":1000},"id":"1011","type":"Paragraph"},{"attributes":{},"id":"5713","type":"AllLabels"},{"attributes":{"text":"&lt;H2&gt;Protein Substitution Tracking&lt;/H2&gt;","width":1000},"id":"1010","type":"Div"},{"attributes":{"text":"\n        The trending SASRS-CoV-2 variants are estimated from weekly growth rates over the past 8 weeks.\n        ","width":1000},"id":"1009","type":"Paragraph"},{"attributes":{"text":"\n        Phylogenetic Assignment of Named Global Outbreak (PANGO) Lineages is software tool developed by members of the Rambaut Lab. The associated web application was developed by the Centre for Genomic Pathogen Surveillance in South Cambridgeshire and is intended to implement the dynamic nomenclature of SARS-CoV-2 lineages, known as the PANGO nomenclature. Each classification of variant includes the possible attributes of lower classes (e.g., VOC includes the possible attributes of VOI); variant status might escalate or deescalate based on scientific evidence.\n        The plots below show the sequence count and the propotion for the top 10 and all VOC/VOI variants reported by CDC.\n        ","width":1000},"id":"1007","type":"Paragraph"},{"attributes":{"text":"&lt;H2&gt;Trending Variants&lt;/H2&gt;","width":1000},"id":"1008","type":"Div"},{"attributes":{},"id":"5714","type":"CategoricalTickFormatter"},{"attributes":{"text":"&lt;H2&gt;SARS-CoV-2 Variants&lt;/H2&gt;","width":1000},"id":"1006","type":"Div"},{"attributes":{"end":4603824.60178007,"start":3582346.354739148},"id":"1019","type":"Range1d"},{"attributes":{"high":0,"low":10,"palette":["#BBBBBB","#5e4fa2","#3288bd","#66c2a5","#abdda4","#e6f598","#ffffbf","#fee08b","#fdae61","#f46d43","#d53e4f","#9e0142"]},"id":"1021","type":"LogColorMapper"},{"attributes":{"text":" ","width":150},"id":"1003","type":"Div"},{"attributes":{"tile_source":{"id":"1020"}},"id":"1046","type":"TileRenderer"},{"attributes":{"attribution":"&amp;copy; &lt;a href=\"https://www.openstreetmap.org/copyright\"&gt;OpenStreetMap&lt;/a&gt; contributors,&amp;copy; &lt;a href=\"https://cartodb.com/attributions\"&gt;CartoDB&lt;/a&gt;","url":"https://tiles.basemaps.cartocdn.com/light_all/{z}/{x}/{y}.png"},"id":"1020","type":"WMTSTileSource"},{"attributes":{},"id":"1412","type":"Title"},{"attributes":{},"id":"1414","type":"AllLabels"},{"attributes":{},"id":"1415","type":"BasicTickFormatter"},{"attributes":{"overlay":{"id":"1454"}},"id":"1450","type":"BoxZoomTool"},{"attributes":{},"id":"1698","type":"Selection"},{"attributes":{},"id":"1699","type":"UnionRenderers"},{"attributes":{"axis":{"id":"1443"},"dimension":1,"grid_line_color":null,"ticker":null},"id":"1445","type":"Grid"},{"attributes":{"children":[{"id":"1424"},{"id":"1422"}]},"id":"1425","type":"Column"},{"attributes":{},"id":"1440","type":"BasicTicker"},{"attributes":{"fill_alpha":{"value":0.4},"fill_color":{"field":"acc","transform":{"id":"1427"}},"line_alpha":{"value":0.4},"line_color":{"value":null},"size":{"field":"size"},"x":{"field":"pos"},"y":{"field":"gene"}},"id":"1467","type":"Circle"},{"attributes":{"axis_line_color":null,"formatter":{"id":"5303"},"major_label_polic
